import React from "react";
import InputComponent from "./Input";

export default function LoginComponents() {
    return (
        <div>
            <InputComponent
                type="text"
                id="name"
                description="Nome"
                placeholder="NomeFantasia"
            />
            <InputComponent
                type="password"
                id="password"
                description="Senha"
                placeholder="********"
            />
        </div>
    );
}
